#include "libft_test.h"

static void test_ft_memcmp_one(void *s1, void *s2, size_t len, int *current, int total) {
	
	*current += 1;

	int ft_ret = ft_memcmp(s1, s2, len);
	int org_ret = memcmp(s1, s2, len);
	assert(org_ret == ft_ret);
	STATUS(*current, total);
}


#ifdef SPEEDTEST
static void test_ft_memcmp_speed(size_t mem_size, size_t n_iter)
{
	CATEGORY("ft_memcmp performance");
	printf("memory size = %zu bytes\n", mem_size);
	printf("number of iterations = %zu\n", n_iter);

	size_t len = mem_size;
	size_t iter = n_iter;

	clock_t start = 0;

	// setup test string
	char *sample = "andjkasb azoxkczkcmzlxkczm zxcn iu bhq uaao bkjcbcz1534 z83x4zx8c4 c1zx184 asda123465";
	size_t sample_len = strlen(sample);

	char *s1 = (char *)malloc(sizeof(char) * len);
	char *s2 = (char *)malloc(sizeof(char) * len);

	size_t ttl_len = 0;
	while (ttl_len < len) {
		size_t cpy_len = sample_len;
		if (ttl_len + sample_len > len) {
			cpy_len = len - ttl_len;
		}
		memcpy(s1 + ttl_len, sample, cpy_len);
		memcpy(s2 + ttl_len, sample, cpy_len);
		ttl_len += cpy_len;
	}

	s1[len - 1] = 0;
	s2[len - 1] = 0;
	s2[(len / 10) * 9] = 'X';
	for (int i = 0; i < iter + 25; i++) {
		if (i == 24)
			start = clock();
		memcmp(s1, s2, len);
	}
	clock_t end = clock();
	double ft_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / ft_time, "memcmp");
	for (int i = 0; i < iter + 10; i++) {
		if (i == 9)
			start = clock();
		ft_memcmp(s1, s2, len);
	}
	end = clock();
	double new_time = (double)(end - start) / CLOCKS_PER_SEC;
	SPEEDRES_NAME(iter / new_time, "ft_memcmp");
	SPEEDCMP((ft_time / new_time) * 100, "memcmp");
	free(s1);
	free(s2);
}
#endif // SPEEDTEST

